import Layout from '../components/Layout';

const Auth = () => (
  <Layout>
    <section id="auth" className="container">
      <h1>Login</h1>
      <form onSubmit={onSubmitHandler}>
        <div className="form-control">
          <label htmlFor="email">Email</label>
          <input type="email"/>
        </div>
        <div className="form-control">
          <label htmlFor="password">Password</label>
          <input type="password"/>
        </div>
        <button type="submit">Login</button>

      </form>





      <style jsx>{`

      h1 {
        font-size: 2rem;
      }
    
      .form-control {
        margin: 1.5rem 0;
      }

      input {
        padding: 0.2rem;
      }

      label {
        display: block;
        font-size: 1.2rem;
      }

      button {
        color: white;
        padding: 0.5rem 1rem ;
        border-radius: 5px;
        font-size: 1rem;
        background-color: #3cbc3e;
        border: none;
        cursor: pointer;
      }

      button:hover {
        background-color: #42af44;
      }
      

    `}</style>
    
    </section>
  </Layout>
);

export default Auth;
